import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPython, faHtml5, faCss3 } from '@fortawesome/free-brands-svg-icons';
import { faDatabase } from '@fortawesome/free-solid-svg-icons'; // Common icon


function Skills() {
  const skills = [
    { name: 'Python', icon: faPython, color: 'blue' },
    { name: 'HTML', icon: faHtml5, color: 'orange' },
    { name: 'CSS', icon: faCss3, color: 'teal' },
    { name: 'SQL', icon: faDatabase, color: 'blue' },
    // Add more skills and icons here
  ];

  return (
    <div className='skills'>
      <h3>SKILLS</h3>
      {skills.map((skill, index) => (
        <div key={index} className='skill-item'>
          <FontAwesomeIcon icon={skill.icon} size="2x" color={skill.color} />
          <span>{skill.name}</span>
        </div>
      ))}
    </div>
  );
}

export default Skills;
